import React, { Component } from "react";
import Card from "./Card";
const token =
  "52615ebb3fb8336a474fd1ab9ec8ae053f5321433e1cbfefefb33a1779816ba9";
const url = "https://api.trello.com";
const key = "23fe0646c0d1253eb430f7e02db925a0";
class List extends Component {
  state = {
    // addCard: false,
    //cards = [],
  };
  componentDidMount() {
    url = `https://api.trello.com/1/lists/5e8838bc95f9447a48ade567/cards?key=${key}&token=${token}`;
    fetch(url)
      .then((res) => res.json())
      .then((result) => {
        console.log(result);
        this.setState({ cards: result });
      });
  }
  render() {
    const cards = this.state;
    console.log(cards);
    return (
      <div className="name">
        <h2>Doing</h2>
      </div>
    );
  }
}

export default List;
